import Head from 'next/head'

const Seo = ({ titlePage, myApp }) => {
  return (
    <Head>
      <title>
        {titlePage} | {myApp}
      </title>
      <link rel="icon" href="../public/favicon.ico" />
    </Head>
  )
}

export default Seo
